INSERT INTO `scripts` (`id`, `scriptName`, `commands`, `description`) VALUES
(5,	'Mikrotik backup',	'ssh2->connect\nssh2->command(\'/file remove [ /file find name~\"bacon-backup\" ]\')\nssh2->command(\'/export file=\"bacon-backup-{datetime}.rsc\"\')\nssh2->command(\'/export compact file=\"bacon-backup-compact-{datetime}.rsc\"\')\nssh2->command(\'/system backup save name=\"bacon-backup-{datetime}.backup\"\')\nssh2->disconnect\nscp->get(\'bacon-backup-{datetime}.rsc\')\n',	''),
(6,	'Cisco telnet TFTP backup',	'telnet->connect\r\ntelnet->command(\'copy running-config tftp://94.74.192.228/switch_backup/cisco/{host}-{datetime}.cfg\')\r\ntelnet->command(\'\',\'/remote host/i\')\r\ntelnet->command(\'\',\'/Destination filename/i\')\r\ntelnet->logLastCommand\r\ntelnet->disconnect',	''),
(7,	'Huawei backup SSH1',	'ssh1->connect\nssh1->setLogError(1)\nssh1->command(\'tftp 94.74.192.228 put confi.cfg switch_backup/huawei/{host}-{datetime}.cfg\')\nssh1->setLogError(1)\nssh1->command(\'tftp 94.74.192.228 put config.cfg switch_backup/huawei/{host}-{datetime}.cfg\',\'/unable/i\')\nssh1->setLogError(1)\nssh1->command(\'tftp 94.74.192.228 put con.cfg switch_backup/huawei/{host}-{datetime}.cfg\',\'/unable/i\')\nssh1->logLastCommand\nssh1->disconnect',	''),
(8,	'Huawei backup SSH2',	'ssh2->connect\nssh2->command(\'tftp 94.74.192.228 put 3comoscfg.cfg switch_backup/huawei/{host}-{datetime}.cfg\')\nssh2->logLastCommand\nssh2->disconnect',	'');
